import React from "react" ; 
import ReactDom from "react-dom" ;
import * as obj from "./App" ;  


ReactDom.render(
  <>
    {obj.App()}
    <obj.greet name = "Shivam Nerwal " gf="Sunny leone "/>
  </> , 
  document.getElementById("root") 
);
